import React from "react";
import "../App.css";

function Home() {
  const differentNoOptions = [
    "NO",
    "Are you sure?",
    "Think again",
    "This must be a mistake",
    "One more chance",
    "Really?",
    "Try again",
  ];

  const handleOnClick = differentNoOptions[+1];

  return (
    <div>
      <div
        style={{
          width: "100%",
          height: 0,
          paddingBottom: "75%",
          position: "relative",
        }}
      >
        <iframe
          src="https://giphy.com/embed/ikXcqqlSNH2Mw"
          width="100%"
          height="100%"
          style={{ position: "absolute" }}
          className="giphy-embed"
          allowFullScreen
          title="Giphy Embed"
        ></iframe>
        <p>
          <a href="https://giphy.com/gifs/ikXcqqlSNH2Mw">via GIPHY</a>
        </p>
      </div>
      <h1 class="question">Will you be my Valentine?</h1>
      <div class="buttons">
        <button id="yes-button">YES</button>
        <button onClick={handleOnClick} id="no-button">
          {differentNoOptions[0]}
        </button>
      </div>
    </div>
  );
}

export default Home;
